required:
  - APIFormIdentifierID
  - RegistrationKey
type: object
properties:
 
  APIFormIdentifierID: 
    type: integer
    description: The APIFormIdentifierID is 50. This is a unique identifier that serves the purpose of identifying a particular request. It helps identify and map the request to the correct endpoint.

  RegistrationKey: 
    type: string
    description: A registration key is a unique ID generated from the system when an admin is registered in the clearinghouse portal.
    maxLength: 100
    minLength: 4
  
    